using ObjectiveC;using System;using SharpSwift.Attributes;using System.Collections.Generic;using Foundation;using CoreGraphics;namespace UIKit{    /// <summary>    /// Constants that specify the edges of a rectangle.    /// </summary>    [iOSVersion(7)]    public enum UIRectEdge    {        /// <summary>        /// No edge.        /// </summary>        [iOSVersion(7)]        None,        /// <summary>        /// The top edge of the rectangle.        /// </summary>        [iOSVersion(7)]        Top,        /// <summary>        /// The left edge of the rectangle.        /// </summary>        [iOSVersion(7)]        Left,        /// <summary>        /// The bottom edge of the rectangle.        /// </summary>        [iOSVersion(7)]        Bottom,        /// <summary>        /// The right edge of the rectangle.        /// </summary>        [iOSVersion(7)]        Right,        /// <summary>        /// All edges of the rectangle.        /// </summary>        [iOSVersion(7)]        All,    }}